define('text!views/todo.html',[],function () { return '<section>\r\n    <h2 class="page-title" data-bind="text: title"></h2>\r\n\r\n    <ul>\r\n        <li>\r\n            Example of validation using the MetaData JayData brings down, as well as the ko observable checking validation on observable change<br />\r\n            <i>\r\n                *Notice the automatic validation if you try to edit the "Is Synchronized"" column from anything other than true or false\r\n            </i>\r\n        </li>\r\n        <li>\r\n            Example of using the built-in JayData adapters for local database storage, using IndexedDB, Web Sql, or localstorage\r\n        </li>\r\n    </ul>\r\n        \r\n    \r\n\r\n    <form class="column vform" id="addTaskForm" data-bind="submit: submitForm ">\r\n        <fieldset>\r\n            <legend>Add Todo</legend>\r\n            <input data-bind="value: taskInput" id="taskInput" />\r\n            <input type="submit" value="Add item" />\r\n        </fieldset>\r\n    </form>\r\n    <div class="column" style="float:left">\r\n        <h3>Local Task List <button class="btn-success" data-bind="click: synchronizeData">Manual Synchronize</button></h3>\r\n        \r\n        <table class="table table-striped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Task</th>\r\n                    <th>Is Synchronized</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: localTodos">\r\n                <tr>\r\n                    <td><input data-bind="value:Task" /></td>\r\n                    <td><input data-bind="value: InSync" /></td>\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n    </div>\r\n    <div style="float:left; margin-right:40px"> &nbsp;</div>\r\n    <div class="column" style="float:left">\r\n        <h3>Remote Task List</h3>\r\n        \r\n        <table class="table table-striped">\r\n            <thead>\r\n                <tr>\r\n                    <th>Task</th>\r\n                    <th>Is Synchronized</th>\r\n                </tr>\r\n            </thead>\r\n            <tbody data-bind="foreach: remoteTodos">\r\n                <tr>\r\n                    <td data-bind="text:Task"></td>\r\n                    <td data-bind="text: InSync"></td>\r\n\r\n                </tr>\r\n            </tbody>\r\n        </table>\r\n\r\n\r\n    </div>\r\n   <div style="clear:both"></div>\r\n\r\n</section>';});

define('text!views/typography.html',[],function () { return '<section>\r\n    <div class="row">\r\n        <div class="col-lg-12">\r\n            <h1>Typograhy <small>Text and Headers</small></h1>\r\n            <ol class="breadcrumb">\r\n                <li><a href="index.html"><i class="fa fa-dashboard"></i> Dashboard</a></li>\r\n                <li class="active"><i class="fa fa-font"></i> Typograhy</li>\r\n            </ol>\r\n            <div class="alert alert-info alert-dismissable">\r\n                <button type="button" class="close" data-dismiss="alert" aria-hidden="true">&times;</button>\r\n                Visit <a class="alert-link" target="_blank" href="http://getbootstrap.com/css/#type">Bootstrap\'s Typography Documentation</a> for more information.\r\n            </div>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Heading 1 <small>Sub-heading</small></h1>\r\n            <h2>Heading 2 <small>Sub-heading</small></h2>\r\n            <h3>Heading 3 <small>Sub-heading</small></h3>\r\n            <h4>Heading 4 <small>Sub-heading</small></h4>\r\n            <h5>Heading 5 <small>Sub-heading</small></h5>\r\n            <h6>Heading 6 <small>Sub-heading</small></h6>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Example Body Copy Text</h1>\r\n            <p class="lead">This is an example of lead body copy.</p>\r\n            <p>This is an example of standard paragraph text. This is an example of <a href="#">link anchor text</a> within body copy.</p>\r\n            <p><small>This is an example of small, fine print text.</small></p>\r\n            <p><strong>This is an example of strong, bold text.</strong></p>\r\n            <p><em>This is an example of emphasized, italic text.</em></p>\r\n            <h1>Alignment Classes</h1>\r\n            <p class="text-left">Left aligned text.</p>\r\n            <p class="text-center">Center aligned text.</p>\r\n            <p class="text-right">Right aligned text.</p>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Emphasis Classes</h1>\r\n            <p class="text-muted">This is an example of muted text.</p>\r\n            <p class="text-primary">This is an example of primary text.</p>\r\n            <p class="text-success">This is an example of success text.</p>\r\n            <p class="text-info">This is an example of info text.</p>\r\n            <p class="text-warning">This is an example of warning text.</p>\r\n            <p class="text-danger">This is an example of danger text.</p>\r\n        </div>\r\n    </div><!-- /.row -->\r\n\r\n    <div class="row">\r\n        <div class="col-lg-4">\r\n            <h1>Abbreviations</h1>\r\n            <p>The abbreviation of the word attribute is <abbr title="attribute">attr</abbr>.</p>\r\n            <p><abbr title="HyperText Markup Language" class="initialism">HTML</abbr> is an abbreviation for a programming language.</p>\r\n            <h1>Addresses</h1>\r\n            <address>\r\n                <strong>Twitter, Inc.</strong><br>\r\n                795 Folsom Ave, Suite 600<br>\r\n                San Francisco, CA 94107<br>\r\n                <abbr title="Phone">P:</abbr> (123) 456-7890\r\n            </address>\r\n\r\n            <address>\r\n                <strong>Full Name</strong><br>\r\n                <a href="mailto:#">first.last@example.com</a>\r\n            </address>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Blockquotes</h1>\r\n            <h2>Default Blockquote</h2>\r\n            <blockquote>\r\n                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.</p>\r\n            </blockquote>\r\n            <h2>Blockquote with Citation</h2>\r\n            <blockquote>\r\n                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.</p>\r\n                <small>Someone famous in <cite title="Source Title">Source Title</cite></small>\r\n            </blockquote>\r\n            <h2>Right Aligned Blockquote</h2>\r\n            <blockquote class="pull-right">\r\n                <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.</p>\r\n            </blockquote>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Lists</h1>\r\n            <h2>Unordered List</h2>\r\n            <ul>\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n                <ul>\r\n                    <li>List Item</li>\r\n                    <li>List Item</li>\r\n                    <li>List Item</li>\r\n                </ul>\r\n                <li>List Item</li>\r\n            </ul>\r\n            <h2>Ordered List</h2>\r\n            <ol>\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n            </ol>\r\n            <h2>Unstyled List</h2>\r\n            <ul class="list-unstyled">\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n            </ul>\r\n            <h2>Inline List</h2>\r\n            <ul class="list-inline">\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n                <li>List Item</li>\r\n            </ul>\r\n        </div>\r\n    </div><!-- /.row -->\r\n\r\n    <div class="row">\r\n        <div class="col-lg-4">\r\n            <h1>Descriptions</h1>\r\n            <dl>\r\n                <dt>Standard Description List</dt>\r\n                <dd>Description Text</dd>\r\n                <dt>Description List Title</dt>\r\n                <dd>Description List Text</dd>\r\n            </dl>\r\n            <dl class="dl-horizontal">\r\n                <dt>Horizontal Description List</dt>\r\n                <dd>Description Text</dd>\r\n                <dt>Description List Title</dt>\r\n                <dd>Description List Text</dd>\r\n            </dl>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Code</h1>\r\n            <p>This is an example of an inline code element within body copy. Wrap inline code within a <code>&lt;code&gt;...&lt;/code&gt;</code> tag.</p>\r\n            <pre>This is an example of preformatted text.</pre>\r\n        </div>\r\n        <div class="col-lg-4">\r\n            <h1>Bootstrap Docs</h1>\r\n            <p>For complete documentation, please visit <a target="_blank" href="http://getbootstrap.com/css/#type">Bootstrap\'s Typograhpy Documentation</a>.</p>\r\n        </div>\r\n    </div><!-- /.row -->\r\n</section>';});

